import Link from 'next/link'

const linkStyle = {
  marginRight: 15,
  paddingLeft: 20
}

export default function Header() {
  return (
    <div className="rectangle1">
      <Link className="title" href="/">
        <h1>Jack Diamond</h1>
      </Link>
      <Link class="questions" href="/experience">
        <a class="questions">questions</a>
      </Link>
      <Link href="/projects">
        <a style={linkStyle}>Projects</a>
      </Link>
      <Link href="/resume">
        <a style={linkStyle}>Resume</a>
      </Link>
      <Link href="/contact">
        <a style={linkStyle}>Contact</a>
      </Link>
      <style jsx>{`
        .rectangle1 {
          background: #FFFFFF;
          box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.25);
        }

        .title {
          margin: 100px;

          font-family: Roboto;
          font-style: normal;
          font-weight: normal;
          font-size: 18px;
          line-height: 21px;

          color: #000000;
        }

        .questions {
          position: absolute;
          left: 57.82%;
          right: 35.64%;
          top: 36.54%;
          bottom: 36.54%;

          font-family: Roboto;
          font-style: normal;
          font-weight: normal;
          font-size: 12px;
          line-height: 14px;

          color: rgba(0, 0, 0, 0.6);
        }

        a {
          padding: 0 10px;
          text-decoration: none;
          font-size: 16px;
          color: #666;
          font-family: Sans-Serif;
        }
      `}</style>
    </div>
  )
}
